import { StyledTextsMain } from "./style";

const Main = () => {
    return (
        <StyledTextsMain>
            <p>Desenvolvedores Voluntários</p>
            <p>para sua ONG</p>
            <p>Somos uma empresa que projeta sites de forma totalmente gratuita para organizações não governamentais e projetos sociais em todo o Brasil.</p>
        </StyledTextsMain>
    )
}

export default Main;
